import React from "react";

export const TileList = ({ data }) => {
  return (
    <div className="tile-list">
      {data.map((item, index) => (
        <div key={index} className="tile">
          <h3>{item.title}</h3>
          <p>{item.description}</p>
        </div>
      ))}
    </div>
  );
};
